import logo from './logo.png';
import love from './love.png';
import "./style.css"
export const Navbar=()=>{
    return(
        <nav className='nav'>
            
                    <img src={logo} id="logo"></img>
                



                    <p id='love'></p>
                    <img src={love} id="love"></img>
                
            
            {/*<button className='xd'   type="button">
